import React, { useState } from 'react';
import './AllApartmentsForSaleModal.css';



const AllApartmentsForSaleModal = ({ apartments, onClose, onSelect }) => {
    return (
        <div className="modal-overlay">
            <div className="modal-content">
                <h2>Избери Апартамент</h2>
                <ul className="apartment-list">
                    {apartments.map((apartment, index) => (
                        <li key={index} onClick={() => onSelect(apartment.number)}>
                            Апартамент №{apartment.number}
                        </li>
                    ))}
                </ul>
                <button className="close-button" onClick={onClose}>
                    Затвори
                </button>
            </div>
        </div>
    );
};

export default AllApartmentsForSaleModal;
